import React from 'react';
import './TopAttractions.css';

const TopAttractions = () => {
    const attractions = [
        { name: "Faisal Mosque", description: "One of the largest mosques in the world." },
        { name: "Daman-e-Koh", description: "A scenic lookout with a view of Islamabad." },
        { name: "Rawal Lake", description: "A beautiful lake with picnic spots." },
    ];

    return (
        <section className="top-attractions">
            <h3>Top Attractions in Islamabad</h3>
            <div className="attractions-list">
                {attractions.map((attraction, index) => (
                    <div key={index} className="attraction-card">
                        <h4>{attraction.name}</h4>
                        <p>{attraction.description}</p>
                    </div>
                ))}
            </div>
        </section>
    );
};

export default TopAttractions;
